import React from "react";
import web from "../Images/home_pic.png";
const About = () => {
  return (
    <div className="d-block">
      <div className="d-block container-fluid d-flex align-items-center">
        <div className=" row">
          <div className=" col-10 mx-auto">
            <div className="about-text pt-lg-0 col-lg-12  order-lg-1 d-flex justify-content-center flex-column">
              <h2>About Me</h2>
              <p>
                Hi! I am Maah. Currently, I am in my fourth-year, pursuing
                computer science degree at Western University.
                <br /> I am also working as a Quality-Assurance Engineer Intern
                at Royal Bank of Canada (RBC) located in <br />
                Mississauga, Ontario.
                <br />
                <br />
                Recently, I discovered my passion for illustration. Thus, I
                decided to self-taught myself digital illustration from scratch,
                and bring creative ideas to live. <br />
                <br />
                When I am not coding, or pushing pixels, you'll find me hanging
                out with friends, working out, or binge-watching on Netflix.
              </p>
            </div>
            <div className="col-md-4 order-1 order-lg-2 about-img d-flex justify-content-center">
              <img
                src={web}
                className="image-fluid animated"
                alt="About Image"
              />
            </div>
          </div>
          {/* </div> */}
        </div>
      </div>
    </div>

    // <section id="about">

    // </section>
  );
};

export default About;
